import React from 'react';
import MovieTitle from '../components/MovieTitle';
import MovieData from '../components/MovieData';
import './styles.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import ElementMovie from '../components/ElementMovie';

fetch('https://swapi.co/api/films/')
	.then(response => {
        return response.json();
    }).then(data => {
        let movies = data.results;


        movies.forEach(element => {
            let titulo = element.title;
         return titulo;

       });


    })





    const data = {
        nameTitles: "Star Wars - A New Hope",
        directors: "George Lucassss",
        episode_ids: 4,
    }

const Movie = () => (
        <div className="mt-5">
            <div className="row">
                <div className="elemto col-md-12 shadow p-3 mb-5 bg-white rounded">
                    <div className="col-md-12">
                        <h1><MovieTitle nameTitle={data.nameTitles}></MovieTitle></h1>
                    </div>
                    <div className="col-md-12">
                        <span><MovieData director={data.directors} episode_id={data.episode_ids}></MovieData></span>
                    </div>
                </div>
                <div className="elemto col-md-12 shadow p-3 mb-5 bg-white rounded">
                    <div className="col-md-12">
                        <h1><MovieTitle nameTitle={"Star Wars - A New Hope"}></MovieTitle></h1>
                    </div>
                    <div className="col-md-12">
                        <span><MovieData director={"George Lucas"} episode_id={4}></MovieData></span>
                    </div>
                </div>
            </div> 
            <img className="naveDos animated fadeInDown" src="nave.png"></img>
            <img className="naveUno animated fadeInDown" src="halcon.png"></img>
        </div>

);



export default Movie;

class MyComponent extends React.Component {
    constructor() {
      super()
      this.state = { movies: [] }
    }

    componentDidMount() {
      var myRequest = new Request('https://swapi.co/api/films/');
      let movies = [];

      fetch(myRequest)
        .then(response => response.json())
        .then(data => {
          this.setState({ movies: data })
        })
    }

    render() {
      return (
        <div>
          <h1>Movie List</h1>
          <ul>
            {this.state.movies.map(movie => {
              return <li key={`movie-${movie.id}`}>{movie.name}</li>
            })}
          </ul>
        </div>
      )
    }
  }
